import logo from './Logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
        <header>

        </header>
        <div id='nav-bar'>
            <nav>
                <ul>
                    <li><img src={logo} alt="#"/></li>
                    <li><a href="#">About</a></li>
                    <li><a href="#">How it works</a></li>
                    <li><a href="#">Contact</a></li>
                </ul>
            </nav>
        </div>
        <main>

        </main>
        <footer>

        </footer>
    </div>
  );
}

export default App;
